import React, { Component } from 'react';
import { Row, Col } from 'antd';

class Admin extends Component {
  render() {
    return (
      <Row>
        <Col span="3">
          Left
        </Col>
        <Col span="21">
          Right
        </Col>
      </Row>
    )
  }
}

export default Admin;
